/*!
 * @brief ADC method sets registers according routing settings. Call
 *         this method code to route desired pins into:
 *         ADC0, ADC1
 *         peripherals.
 * @param instance - ADC instance number 0..1
 */
void init_adc_pins(uint32_t instance);
/*!
 * @brief ADC method sets registers according routing settings. Call
 *         this method code to disable routing of desired pins for:
 *         ADC0, ADC1
 *         peripherals.
 * @param instance - ADC instance number 0..1
 */
void deinit_adc_pins(uint32_t instance);
/*!
 * @brief CAN method sets registers according routing settings. Call
 *         this method code to route desired pins into:
 *         CAN0, CAN1
 *         peripherals.
 * @param instance - CAN instance number 0..1
 */
void init_can_pins(uint32_t instance);
/*!
 * @brief CAN method sets registers according routing settings. Call
 *         this method code to disable routing of desired pins for:
 *         CAN0, CAN1
 *         peripherals.
 * @param instance - CAN instance number 0..1
 */
void deinit_can_pins(uint32_t instance);
/*!
 * @brief CMP method sets registers according routing settings. Call
 *         this method code to route desired pins into:
 *         CMP0, CMP1, CMP2
 *         peripherals.
 * @param instance - CMP instance number 0..2
 */
